pragma solidity >=0.4.22 <0.7.0;

contract UserContract{
    
    address admin;
    
    
    //user
    mapping(address => User) registeredUser;
    //user addr->ID
    mapping(uint => address) uIDtoAddress;
    //user
    mapping(uint => bool) isResteredUser;
    
    
    //
    struct User{
        address uAccount;
        uint uID;
        string uName;
        string uGender;
        string uBirth;
        string uNation;
        bool uisActive;
    }
    
    
    //address
    event e_getAddedUserbyAddr(
        address uAccount,
        uint uID,
        string uName,
        string uGender,
        string uBirth,
        string uNation);
    //ID   
    event e_getAddedUserbyuID(
        address uAccount,
        uint uID,
        string uName,
        string uGender,
        string uBirth,
        string uNation);
    
    
    //
    event e_addUser(
        address newUserAddress,
        uint uID, 
        string uName, 
        string uGender, 
        string uBirth,
        string uNation);
    //
    event e_addUser(
        uint uID, 
        string uName, 
        string uGender, 
        string uBirth,
        string uNation);
    
    //
    modifier onlyAdmin{
        require(msg.sender == admin);
        _;
    }
    
    
    //user
    function getAddedUserbyAddr(address UserAddress) public  onlyAdmin  returns(
        address uAccount,
        uint uID,
        string memory uName,
        string memory uGender,
        string memory uBirth,
        string memory uNation) {
        
        //
        require(registeredUser[UserAddress].uisActive == true);
        //
        User storage user = registeredUser[UserAddress];
        
        //event
        emit e_getAddedUserbyAddr(
            UserAddress,
            user.uID,
            user.uName,
            user.uGender,
            user.uBirth,
            user.uNation);
        
        //
        return(
            UserAddress,
            user.uID,
            user.uName,
            user.uGender,
            user.uBirth,
            user.uNation);
    }
    
    //user
    function getAddedUserbyuID(uint userID) public onlyAdmin returns(
        address uAccount,
        uint uID,
        string memory uName,
        string memory uGender,
        string memory uBirth,
        string memory uNation) {
        
        //
        require(registeredUser[uIDtoAddress[userID]].uisActive == true);
        //
        address UserAddressbyuID = uIDtoAddress[userID];
        User storage user = registeredUser[UserAddressbyuID];
        
        //event
        emit e_getAddedUserbyuID(
            UserAddressbyuID,
            user.uID,
            user.uName,
            user.uGender,
            user.uBirth,
            user.uNation);
        
        //
        return(
            UserAddressbyuID,
            user.uID,
            user.uName,
            user.uGender,
            user.uBirth,
            user.uNation);
    }
    
    
    ////User
    //User
    function addUser(
        address newUserAddress,
        uint uID, 
        string memory uName, 
        string memory uGender, 
        string memory uBirth,
        string memory uNation) public{
            
        //
        require(!isResteredUser[uID]);
        require(newUserAddress == msg.sender);
        //IDaddress
        uIDtoAddress[uID] = newUserAddress;
        //
        registeredUser[newUserAddress] = User({
            uAccount : newUserAddress, 
            uID : uID,
            uName : uName, 
            uGender : uGender, 
            uBirth : uBirth,
            uNation : uNation,
            uisActive : true});
        isResteredUser[uID] = true;
        //event
        emit e_addUser(
            newUserAddress, 
            uID, uName, 
            uGender, 
            uBirth,
            uNation);
    }
    
    
    
    //User
    function getUserInfo(uint _uID) public returns(
        uint uID, 
        string memory uName, 
        string memory uGender, 
        string memory uBirth,
        string memory uNation) {
        
        //
        require(uIDtoAddress[_uID] == msg.sender);
        //user
        User storage user = registeredUser[msg.sender];
        //event
        emit e_addUser(
            user.uID, 
            user.uName, 
            user.uGender, 
            user.uBirth,
            user.uNation);
        //    
        return(
            user.uID, 
            user.uName, 
            user.uGender, 
            user.uBirth,
            user.uNation);
    }
     
}
